{"profile_image": null, "search_description": "", "owner": 1, "position_at_new_america": "President and CEO", "long_bio": "Anne-Marie Slaughter is currently the President and CEO of New America, a think tank and civic enterprise with offices in Washington and New York. She is also the Bert G. Kerstetter '66 University Professor Emerita of Politics and International Affairs at Princeton University. From 2009–2011 she served as director of Policy Planning for the United States Department of State, the first woman to hold that position. Upon leaving the State Department she received the Secretary’s Distinguished Service Award for her work leading the Quadrennial Diplomacy and Development Review, as well as meritorious service awards from USAID and the Supreme Allied Commander for Europe. Prior to her government service, Dr. Slaughter was the Dean of Princeton’s Woodrow Wilson School of Public and International Affairs from 2002–2009 and the J. Sinclair Armstrong Professor of International, Foreign, and Comparative Law at Harvard Law School from 1994-2002.

Dr. Slaughter has written or edited seven books, including Unfinished Business: Women, Men, Work, Family (2015), A New World Order (2004), and The Idea That Is America: Keeping Faith with Our Values in a Dangerous World (2007), and over 100 scholarly articles. She was the convener and academic co-chair, with Professor John Ikenberry, of the Princeton Project on National Security, a multi-year research project aimed at developing a new, bipartisan national security strategy for the United States. In 2012 she published the article “Why Women Still Can’t Have It All,” in The Atlantic, which quickly became the most read article in the history of the magazine and helped spawn a renewed national debate on the continued obstacles to genuine full male-female equality.

Dr. Slaughter writes a monthly column for Project Syndicate. She provides frequent commentary for both mainstream and new media and curates foreign policy news for over 80,000 followers on Twitter. Foreign Policy magazine named her to their annual list of the Top 100 Global Thinkers in 2009, 2010, 2011, and 2012. She received a B.A. from Princeton, an M.Phil and D.Phil in international relations from Oxford, where she was a Daniel M. Sachs Scholar, and a J.D. from Harvard. She is married to Professor Andrew Moravcsik; they live in Princeton with their two sons.", "latest_revision_created_at": null, "go_live_at": null, "social_media": "[]", "expert": true, "title": "Anne-Marie Slaughter", "seo_title": "", "slug": "anne-marie-slaughter", "live": true, "role": "Board Member", "location": "", "has_unpublished_changes": false, "email": "anne@newamerica.org", "numchild": 0, "content_type": 14, "show_in_menus": false, "path": "0001000100050001", "url_path": "/new-america/our-people/anne-marie-slaughter/", "expired": false, "pk": 38, "locked": false, "first_name": "Anne-Marie Slaughter", "depth": 4, "short_bio": "Anne-Marie Slaughter is currently the President and CEO of New America, a think tank and civic enterprise with offices in Washington and New York.", "first_published_at": null, "expire_at": null}

{"profile_image": null, "search_description": "", "owner": 1, "position_at_new_america": "Director, Open Technology Institute", "long_bio": "Kevin Bankston is the Director of New America’s Open Technology Institute, where he works in the public interest to promote policy and regulatory reforms to strengthen communities by supporting open communications networks, platforms, and technologies. He previously served as OTI's Policy Director.

Prior to leading OTI’s policy team, Kevin was a Senior Counsel and the Director of the Free Expression Project at the Center for Democracy & Technology, a Washington, DC-based non-profit organization dedicated to promoting democratic values and constitutional liberties in the digital age. From that position, he spent two years advocating on a wide range of Internet and technology policy issues both international and domestic, most recently organizing a broad coalition of companies and civil society organizations to demand greater transparency around the US government’s surveillance practices. He also has served since 2005 on the board of the First Amendment Coalition, a non-profit public interest organization dedicated to advancing free speech and a more open and accountable government, and previously was a nonresidential fellow at the Stanford Law School’s Center for Internet & Society.

Prior to joining CDT, he worked for nearly a decade at the Electronic Frontier Foundation, specializing in free speech and privacy law with a focus on government surveillance, Internet privacy, and location privacy. As a Senior Staff Attorney at EFF, he regularly litigated issues surrounding free expression and electronic surveillance, and was a lead counsel in EFF’s lawsuits against the National Security Agency and AT&T, challenging the legality of the NSA warrantless wiretapping program first revealed in 2005. He originally joined EFF as an Equal Justice Works/Bruce J. Ennis First Amendment Fellow, studying the impact of post-9/11 anti-terrorism surveillance initiatives on online privacy and free expression. Before joining EFF, he litigated Internet-related free speech cases at the national office of the American Civil Liberties Union in New York City as a Justice William Brennan First Amendment Fellow. He received his JD at the University of Southern California Law School after receiving his BA at the University of Texas at Austin.", "latest_revision_created_at": null, "go_live_at": null, "social_media": "[]", "expert": true, "title": "Kevin Bankston", "seo_title": "", "slug": "kevin-bankston", "live": true, "program": 87, "role": "Staff", "location": "", "has_unpublished_changes": false, "email": "kevin@kevin.com", "numchild": 0, "content_type": 14, "show_in_menus": false, "path": "0001000100050002", "url_path": "/new-america/our-people/kevin-bankston/", "expired": false, "pk": 125, "locked": false, "first_name": "Kevin Bankston", "depth": 4, "short_bio": "Kevin Bankston is the Director of New America’s Open Technology Institute, where he works in the public interest to promote policy and regulatory reforms to strengthen communities by supporting open communications networks, platforms, and technologies. He previously served as OTI's Policy Director.", "first_published_at": null, "expire_at": null}

